获取部门扩展属性对象

根据用户编号获取该用户的扩展属性，主要用于具体业务下，判断部门是否为工区、班组等

请求路径

/cispplatform/baseCenter/userOrgService/deptExts/deptNo

请求方式

POST + JSON

请求参数

{  

    "deptNo": ""       /**  部门编码**/  

}  

返回参数

{  

    "status": "000000",  

    "errors": null,  

    "result": [  

        {  

        "extId": "", //扩展属性ID  

              "deptNo": "", //部门编号  

              "extAttr": "",  //扩展属性代码  

              "extValue": "" //扩展属性值  

        }  

    ]  

}  

