{  

    "status": "000000",  

    "errors": null,  

    "result": [  

        {  

        "extId": "C208FFC81814890ADD1404F0FD6F9C11",  

        "deptNo": "011492E6E9761FD6660418E53FEA40FD",  

        "extAttr": "IsNot95598",  

        "extValue": "Y"  

